import React from "react";
import "./Quiz.css";
import Navbar from 'react-bootstrap/Navbar';
import CampaignIcon from '@mui/icons-material/Campaign';
function Quiz(){
    return <>

        <Navbar bg="light" expand="lg">
        <h1><CampaignIcon className="speaker" fontSize="60" />Quizz</h1>
        <h2></h2>
        </Navbar>
    </>
}

export default Quiz;
